import React from 'react';
import ReactDOM from 'react-dom';

const Page = ( <h1> Best players of all time</h1> );

const Yes =()=>{
    return(
        <div>
            <ul style={{ fontSize : '100px' }}><li> Messi</li> <li> Maradona</li> <li> Pele</li></ul>
        </div>
    )
}
ReactDOM.render(Page,document.getElementById("ok"));

ReactDOM.render(<Yes/> ,document.getElementById("root"));
